  false,\n\t\"url\": null,\n\t\"notes\": \"NODC accession 0116858 includes chemical,
  optical and physical data collected aboard the HEALY during cruise HLY10TC in the
  North Pacific Ocean from 2010-05-31 to 2010-06-12. These data include Attenuation/Transmission,
  CONDUCTIVITY, DEPTH - BOTTOM, DEPTH - OBSERVATION, DISSOLVED OXYGEN, HYDROSTATIC
  PRESSURE, SALINITY, WATER TEMPERATURE and surface irradiance. The instruments used
  to collect these data include CTD, PAR Sensor, echo sounder, oxygen meter and transmissometer.
  These data were collected by Dale Chayes of Columbia University; Lamont-Doherty
  Earth Observatory, and by United States Coast Guard as part of Multibeam Sea Acceptance
  Test. The Lamont-Doherty Earth Observatory (LDEO) submitted these data to NODC as
  part of the NSF sponsored Rolling Deck to Repository (R2R) program. The CTD data
  submitted by the originator represent the raw data suite. Processed versions of
  the data were generated by NODC.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
